  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:17.037754\",\n\t\"name\": \"long-lake-national-wildlife-refuge-and-long-lake-wetland-management-district-annual-narrat-23b56\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Long Lake
  NWR, Long Lake WMD, Slade NWR, Florence Lake NWR, and the easement refuges outlines
  Refuge accomplishments during the 2000 calendar year. The report begins with a summary
  of the year's highlights and weather conditions. Land acquisition is covered. The
  report includes a planning section which discusses management planning, public participation,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
  management, pest control, wilderness areas, and WPA easements. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  wildlife propagation, animal control, marking and bird banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  equipment replacement, communication systems, computer systems, and energy conservation.
  Cooperative programs are provided at the end. Refuge brochures and field guides
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
